import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
    const [page, setPage] = useState('home');
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [content, setContent] = useState({});
    const [editContent, setEditContent] = useState({});
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    useEffect(() => {
        fetchContent();
    }, []);

    const fetchContent = async () => {
        try {
            const res = await axios.get('http://localhost:5000/api/content');
            setContent(res.data);
            setEditContent(res.data);
        } catch (err) {
            console.log(err);
        }
    };

    // LOGIN PAGE
    if (page === 'login') {
        return (
            <div style={styles.loginContainer}>
                <div style={styles.loginBox}>
                    <h2 style={styles.loginTitle}>Admin Login</h2>
                    <input 
                        placeholder="Email" 
                        value={email} 
                        onChange={(e) => setEmail(e.target.value)}
                        style={styles.input}
                    />
                    <input 
                        type="password" 
                        placeholder="Password" 
                        value={password} 
                        onChange={(e) => setPassword(e.target.value)}
                        style={styles.input}
                    />
                    <button onClick={async () => {
                        const res = await axios.post('http://localhost:5000/api/auth/login', { email, password });
                        if (res.data.success) {
                            setIsLoggedIn(true);
                            setPage('admin');
                        } else {
                            alert('Invalid credentials');
                        }
                    }} style={styles.loginBtn}>
                        Login
                    </button>
                    <button onClick={() => setPage('home')} style={styles.backBtn}>
                        Back to Home
                    </button>
                    <div style={styles.loginInfo}>
                        <p>Use: admin@gmail.com / 1234</p>
                    </div>
                </div>
            </div>
        );
    }

    // ADMIN PANEL
    if (page === 'admin' && isLoggedIn) {
        return (
            <div style={styles.adminContainer}>
                <div style={styles.adminHeader}>
                    <h2>Edit Content</h2>
                    <button onClick={() => {
                        setIsLoggedIn(false);
                        setPage('home');
                    }} style={styles.logoutBtn}>
                        Logout
                    </button>
                </div>
                {Object.keys(editContent).map(key => (
                    <div key={key} style={styles.editSection}>
                        <label style={styles.label}>{key}</label>
                        <textarea
                            value={editContent[key] || ''}
                            onChange={(e) => setEditContent({...editContent, [key]: e.target.value})}
                            rows="3"
                            style={styles.textarea}
                        />
                    </div>
                ))}
                <button onClick={async () => {
                    await axios.put('http://localhost:5000/api/content', editContent);
                    setContent(editContent);
                    alert('Saved!');
                    setPage('home');
                }} style={styles.saveBtn}>
                    Save Changes
                </button>
            </div>
        );
    }

    // HOME PAGE - EXACT UI LIKE YOUR SCREENSHOT
    return (
        <div style={styles.app}>
            {/* Simple Navbar */}
            <nav style={styles.navbar}>
                <div style={styles.logo}>VIGHNAHARTA INFINITY</div>
                <button onClick={() => setPage('login')} style={styles.adminBtn}>
                    Admin
                </button>
            </nav>

            {/* Main Hero Section - Exactly like your image */}
            <div style={styles.heroContainer}>
                {/* Top Heading */}
                <div style={styles.topHeading}>
                    <div style={styles.thinking}>THINKING</div>
                    <div style={styles.fantastic}>OF A FANTASTIC VICINITY?</div>
                </div>

                {/* Amenities Line */}
                <div style={styles.amenitiesLine}>
                    0+ PODIUM LUXURIOUS AMENITIES | SPACIOUS BALCONY HOMES*
                </div>

                {/* Vighnaharta Infinity - Centered */}
                <div style={styles.brandContainer}>
                    <div style={styles.brandName}>VIGHNAHARTA</div>
                    <div style={styles.brandSub}>INFINITY</div>
                </div>

                {/* Price Cards Container */}
                <div style={styles.priceContainer}>
                    {/* Left Card - 1 BHK */}
                    <div style={styles.priceCard}>
                        <div style={styles.cardTitle}>SMART 1 BHK</div>
                        <div style={styles.cardPrice}>@ 74.99 Lacs*</div>
                        <div style={styles.cardPriceOld}>₹ 69.99 Lacs*</div>
                        <div style={styles.cardOnwards}>onwards</div>
                    </div>

                    {/* Right Card - 2 BHK */}
                    <div style={styles.priceCard}>
                        <div style={styles.cardTitle}>PREMIUM 2 BHK</div>
                        <div style={styles.cardPrice}>@ 1.05 CR</div>
                        <div style={styles.cardPriceOld}>₹ 96.99 Lacs*</div>
                        <div style={styles.cardOnwards}>onwards</div>
                    </div>
                </div>

                {/* Address */}
                <div style={styles.address}>
                    BLDG. NO. 223/224,<br />
                    CIRCLE - KANNAMWAR NAGAR I, VIKHROLI (EAST)
                </div>
            </div>

            {/* Rest of the sections (About, Amenities, etc.) - Add below */}
            <div style={styles.section}>
                <h2>About Project</h2>
                <p>{content.about || 'Your about text here'}</p>
            </div>
        </div>
    );
}

const styles = {
    app: {
        fontFamily: 'Arial, sans-serif',
        backgroundColor: '#fff'
    },

    // Navbar
    navbar: {
        backgroundColor: '#000',
        color: 'white',
        padding: '15px 30px',
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center'
    },
    logo: {
        fontSize: '20px',
        fontWeight: 'bold',
        letterSpacing: '1px'
    },
    adminBtn: {
        backgroundColor: 'transparent',
        border: '1px solid white',
        color: 'white',
        padding: '5px 15px',
        cursor: 'pointer',
        borderRadius: '4px'
    },

    // Hero Section - Exact match
    heroContainer: {
        backgroundColor: '#000',
        color: '#fff',
        padding: '40px 20px 60px',
        textAlign: 'center'
    },
    topHeading: {
        marginBottom: '20px'
    },
    thinking: {
        fontSize: '42px',
        fontWeight: 'bold',
        lineHeight: '1.2',
        color: '#fff'
    },
    fantastic: {
        fontSize: '42px',
        fontWeight: 'bold',
        lineHeight: '1.2',
